import React from "react";
import "./Results.css";

export default function Results() {
  return (
    <div className="weekly-forecast">
      <h2>Weekly Forecast</h2>
      <ul>
        <li>Mon</li>
        <li>Tue</li>
        <li>Wed</li>
        <li>Thur</li>
        <li>Fri</li>
        <li>Sat</li>
        <li>Sun</li>
      </ul>
    </div>
  );
}
